■商品説明<br>
サイズ：約6mm　10mmはこちら♪8mmはこちら♪<br>
カラー：白・生成<br>
数量：100個　卸売りはこちら♪<br>
【貫通タイプ】<br>
穴の直径：約2mm　穴が貫通してるビーズタイプです。<br>
<br>
【未貫通タイプ】<br>
穴の直径：約1.5mm　穴が貫通していません。
<br><br>
■スタッフより一言♪<br>
上品な艶のある綺麗なパールです。<br>
使いやすい6mmサイズです♪<br>
アクセサリーやストラップ、デコのアクセントとしておすすめです。<br>
穴のタイプは貫通、未貫通の2タイプよりお選びください。
<br><br>
※注意※
