■商品説明<br>
サイズ：直径/ホール　約8mm/約1.5mm　約10mm/約1.5mm　約12mm/約1.5mm<br>
カラー：ミックス、縮み加工<br>
数量：【8mm】約480個　【10mm】約240個　【12mm】約180個　
<br><br>
■スタッフより一言♪<br>
縮み加工が施されたしっとりとした上品なつや感のカラーシュリンクパール。<br>可愛いパステルカラーに加え、秋カラーがプラスされた、これからのアクセサリー作りにおすすめのミックスです。<br>サイズは8mm、10mm、12mmと3サイズからお選びいただけます。<br>存在感のあるカラーパールで素敵なアクセサリーを作ってくださいね♪<br>
<br>
おすすめのカラーパールミックスはこちら♪<br>
<img src="https://image.rakuten.co.jp/auc-yumishop/cabinet/01198000/01230287/imgrc0062670149.jpg" width="150"><br><br>
